import React, { Component } from 'react'

export default class test extends Component {

  render() {
    var today = new Date();
    var dateToDay = today.getFullYear()+'-'+today.getMonth()+'-'+today.getDay();
    console.log(dateToDay);
    return (
      <div>
        <h1>Hello React</h1>
      </div>
    )
  }
}
